const INITIAL_STATE = {
    respuestas: [
        {
            'id': 1,
            'texto': 'texto respuesta 1'
        },
        {
            'id': 2,
            'texto': 'texto respuesta 2'
        },
        {
            'id': 3,
            'texto': 'texto respuesta 3'
        },
        {
            'id': 4,
            'texto': 'texto respuesta 4'
        },
    ],
    lastId: 4
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_respuestas':
            return { ...state, respuestas: action.payload }
        case 'crear_respuesta':
            return {
                ...state,
                respuestas: action.payload
            }
        case 'editar_respuesta':
            return {
                ...state,
                respuestas: action.payload
            }
        case 'eliminar_respuesta':
            return {
                ...state,
                respuestas: action.payload
            }
        default:
            return state;
    }
}
